Sections are described by section headers which are in turn stored in the Section Header Table (SHT) . Since the SHT is not pertinent to a binary at runtime, it may be stripped from the file entirely. A corollary of this is the fact that while every ELF object has sections, but not every ELF object has section headers . In fact, a common procedure for hindering reverse engineering and debugging of a binary is to strip the section header table, which makes life rather difficult for debuggers, since they will be unable to directly reference symbol information. Note, however, that this information may still be recovered via analysis of the rest of the binary, and more specifically, of the Programme Header Table due to its inherent overlap between segments and sections. Ultimately, the section header table is an array of the following structures: typedef struct
{ Elf32_Word	sh_name; /* Section name (string tbl index) */ Elf32_Word	sh_type; /* Section type */ Elf32_Word	sh_flags; /* Section flags */ Elf32_Addr	sh_addr; /* Section virtual addr at execution */ Elf32_Off	sh_offset; /* Section file offset */ Elf32_Word	sh_size; /* Section size in bytes */ Elf32_Word	sh_link; /* Link to another section */ Elf32_Word	sh_info; /* Additional section information */ Elf32_Word	sh_addralign; /* Section alignment */ Elf32_Word	sh_entsize; /* Entry size if section holds table */
} Elf32_Shdr; typedef struct
{ Elf64_Word	sh_name; /* Section name (string tbl index) */ Elf64_Word	sh_type; /* Section type */ Elf64_Xword	sh_flags; /* Section flags */ Elf64_Addr	sh_addr; /* Section virtual addr at execution */ Elf64_Off	sh_offset; /* Section file offset */ Elf64_Xword	sh_size; /* Section size in bytes */ Elf64_Word	sh_link; /* Link to another section */ Elf64_Word	sh_info; /* Additional section information */ Elf64_Xword	sh_addralign; /* Section alignment */ Elf64_Xword	sh_entsize; /* Entry size if section holds table */
} Elf64_Shdr; sh_name - the offset (in bytes) from the beginning of the section name string table at which the name of the current section is located. sh_type - the type of the section. sh_flags - sections support 1-bit flags which describe certain attributes. sh_addr - if the section is to be loaded into the memory image of the file, this field contains the address at which the section should reside. It holds 0 otherwise. sh_offset - the offset (in bytes) from the beginning of the file where the section resides. For sections of type SHT_NOBITS, this portrays only a conceptual position. sh_size - the section's size in bytes. Sections of type SHT_NOBITS may have this field set to a non-zero value, but will still occupy no space in the file. sh_link - a link to another section header. The interpretation of this field depends on the section's type. sh_info - this field holds additional information and its interpretation is different based on the section's type sh_type sh_link sh_info SHT_DYNAMIC The section header index of the string table used by entries in the section. 0 SHT_HASH The section header index of the symbol table to which the hash table pertains. 0 SHT_RELSHT_RELA The section header index of the associated symbol table. The section header index of the section to which the relocation applies. SHT_SYMTABSHT_DYNSYM The section header index of the associated string table. One greater than the symbol table index of the last local symbol (binding STB_LOCAL). SHT_GROUP The section header index of the associated symbol table. The symbol table index of an entry in the associated symbol table. The name of the specified symbol table entry provides a signature for the section group. SHT_SYMTAB_SHNDX The section header index of the associated symbol table section. 0 sh_addralign - certain sections have alignment constraints. For example, if the section holds a doubleword, doubleword alignment is to be ensured for the entire section. Values 0 and 1 mean that the section requires no special alignment. Otherwise, only positive integral values of 2 are allowed for this field. Ultimately, sh_addr must be divisible by sh_addralign. sh_entsize - if the section contains some sort of a table of fixed-sized entries, this field holds the entry size. If no such table is present, this member holds 0. If the number of section headers is greater than or equal to SHN_LORESERVE (0xff00), then the e_shnum field of the ELF header holds SHN_UNDEF (0) and the actual number of section headers is stored in the sh_size field of the first entry in the section header table. Certain indices in the section header table are reserved. The first section header has the following form: Name Value Note sh_name 0 No name sh_type SHT_NULL Inactive sh_flags 0 No flags sh_addr 0 No address sh_offset 0 No offset sh_size Unspecified If non-zero, the actual number of section header entries sh_link Unspecified If non-zero, the index of the section header string table section sh_info 0 No auxiliary information sh_addralign 0 No alignment sh_entsize 0 No entries The other reserved indices are described in the following table: Name Value SHN_UNDEF 0 SHN_LORESERVE 0xff00 SHN_LOPROC 0xff00 SHN_HIPROC 0xff1f SHN_LOOS 0xff20 SHN_HIOS 0xff3f SHN_ABS 0xfff1 SHN_COMMON 0xfff2 SHN_XINDEX 0xffff SHN_HIRESERVE 0xffff SHN_LORESERVE - the lower bound for reserved indices. SHN_LOPROC through SHN_HIPROC - reserved for processor-specific semantics. SHN_LOOS through SHN_HIOS - reserved for OS-specific semantics. SHN_ABS - specifies absolute values. For example, symbol definitions relative to this section number are absolutes and are not affected by relocation. SHN_COMMON - symbols defined relative to this section are "common" symbols such as unallocated C external variables. SHN_XINDEX - an escape value denoting an index which cannot fit in the containing field and thus must be found elsewhere (this is specific to the structure it is found in). SHN_HIRESERVE - the upper bound for reserved indices. You can view the section header table by using the -S option in readelf.

