Segments are described by programme headers which are stored in the Programme Header Table (PHT). These structs are again defined in <elf.h>: typedef struct
{ Elf32_Word	p_type; /* Segment type */ Elf32_Off p_offset; /* Segment file offset */ Elf32_Addr	p_vaddr; /* Segment virtual address */ Elf32_Addr	p_paddr; /* Segment physical address */ Elf32_Word	p_filesz; /* Segment size in file */ Elf32_Word	p_memsz; /* Segment size in memory */ Elf32_Word	p_flags; /* Segment flags */ Elf32_Word	p_align; /* Segment alignment */
} Elf32_Phdr; typedef struct
{ Elf64_Word	p_type; /* Segment type */ Elf64_Word	p_flags; /* Segment flags */ Elf64_Off p_offset; /* Segment file offset */ Elf64_Addr	p_vaddr; /* Segment virtual address */ Elf64_Addr	p_paddr; /* Segment physical address */ Elf64_Xword	p_filesz; /* Segment size in file */ Elf64_Xword	p_memsz; /* Segment size in memory */ Elf64_Xword	p_align; /* Segment alignment */
} Elf64_Phdr; p_type - describes the type of the segment. p_offset - the offset from the beginning of the file where the segment resides. p_vaddr - the virtual address at which the segment resides in memory. p_paddr - the segment's physical address, which is relevant only for systems with physical addressing. This member holds unspecified contents for executables and shared objects p_filesz - the number of bytes the segment occupies in the file image. It may be 0. p_memsz - the number of bytes the segment occupies in the memory image. It may be 0. p_align - the value to which the segments are aligned in the file and in memory. If this holds 0 or 1, then no alignment is required. Otherwise, p_align should be a positive integer power of 2 and p_vaddr should be equal to p_offset % p_align. The PHT can be viewed by specifying the -l argument to readelf:

