The dynamic segment is pertinent to executables which avail themselves of dynamic linking and contains information for the dynamic linker. It typically points to the .dynamic section and comprises a series of structures which hold the relevant information. typedef struct
{ Elf32_Sword	d_tag; /* Dynamic entry type */ union { Elf32_Word d_val; /* Integer value */ Elf32_Addr d_ptr; /* Address value */ } d_un;
} Elf32_Dyn; typedef struct
{ Elf64_Sxword	d_tag; /* Dynamic entry type */ union { Elf64_Xword d_val; /* Integer value */ Elf64_Addr d_ptr; /* Address value */ } d_un;
} Elf64_Dyn; In essence, the d_tag field determines whether the d_un field is treated as a value or an address.

