Ultimately, there exist at most two symbol tables in an ELF object - .symtab and .dynsym. The former will also contain the contents of the latter, however, it is not necessary for dynamic linking and is thus usually omitted in the memory image of a binary. The extraneous symbols in .symtab are simply too big and completely useless during execution time, so .dynsym only contains the information absolutely necessary for dynamic linking. You will see that .symtab has no flags, while .dynsym is marked as ALLOC. Both symbol tables contain entries of the following types: typedef struct
{ Elf32_Word	st_name; /* Symbol name (string tbl index) */ Elf32_Addr	st_value; /* Symbol value */ Elf32_Word	st_size; /* Symbol size */ unsigned char	st_info; /* Symbol type and binding */ unsigned char	st_other; /* Symbol visibility */ Elf32_Section	st_shndx; /* Section index */
} Elf32_Sym; typedef struct
{ Elf64_Word	st_name; /* Symbol name (string tbl index) */ unsigned char	st_info; /* Symbol type and binding */ unsigned char st_other; /* Symbol visibility */ Elf64_Section	st_shndx; /* Section index */ Elf64_Addr	st_value; /* Symbol value */ Elf64_Xword	st_size; /* Symbol size */
} Elf64_Sym; st_name - an offset (in bytes) from the beginning of the symbol name string table (either .dynstr or .strtab), where the name of the symbol is located. st_value - the value of the symbol, which is either an address or an offset of its location. st_size - symbols may have an associated size. If this field is 0, the symbol has no size or it is unknown st_other - defines the symbol's visibility. st_shndx - since each symbol is defined in relation to some section, the index of the section header corresponding to the relevant section is stored in this field. st_info - this field specifies the symbol type and binding. You can view the symbol tables by adding the -s flag to readelf: If a symbol's value refers to a specific location within a section, st_shndx holds an index into the section header table. As the section moves during relocation, the symbol's value changes as well. Certain section indices, however, have reserved semantics: SHN_ABS specifies that the symbol value is absolute and won't change during relocation. SHN_COMMON labels a yet unallocated common block. The symbol's value holds alignment constraints. The linker allocates storage for the symbol at an address that is a multiple of the symbol value, while the st_size field holds the number of bytes necessary for the allocation. Such symbols may only occur in relocatable files. SHN_UNDEF specifies an undefined symbol. When the linker combines this object file with another which defines the symbol, this file's references to the symbol will be linked directly to the actual definition. SHN_XINDEX serves as an escape value and indicates that the relevant section header index is too large to fit in the the symbol. Therefore, the section header index is actually found in the SHT_SYMTAB_SHNDX section whose entries correspond one-to-one with those in the symbol table.

